import React from "react";
import UserList from "../components/UserList";

const User = () => {
  const USERS=[
    {id:'1',name:'Siddhant',image:'./', places:'4'},
    {id:'1',name:'Romi',image:'https://static.businessworld.in/article/article_extra_large_image/1653393763_rj9UdW_logo_Meta.png', places:'4'}
  ];
  return <UserList items={USERS}/>;
};

export default User;
